import React from 'react';

const styles = {
  container: {
    maxWidth: 900,
    margin: '0 auto',
    padding: '32px 16px',
    fontFamily: "'Inter', sans-serif",
    color: '#222',
    lineHeight: 1.6,
  } as React.CSSProperties,
  section: {
    marginBottom: 64,
  } as React.CSSProperties,
  headerBox: {
    display: 'flex',
    flexDirection: 'column' as const,
    alignItems: 'center',
    paddingBottom: 24,
    borderBottom: '2px solid #7c3aed',
  },
  iconWrapper: {
    width: 60,
    height: 60,
    borderRadius: '50%',
    background:
      'radial-gradient(circle at center, #a78bfa 0%, #5b21b6 100%)',
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    marginBottom: 16,
    boxShadow:
      '0 4px 10px rgba(167, 139, 250, 0.4), 0 0 8px #7c3aed',
  },
  iconSvg: {
    width: 32,
    height: 32,
    fill: 'white',
  },
  title: {
    fontSize: 24,
    fontWeight: 700,
    color: '#5b21b6',
    textAlign: 'center' as const,
  },
  contentBlock: {
    marginTop: 24,
  },
  paragraph: {
    marginBottom: 12,
    textAlign: 'justify' as const,
    fontSize: 16,
  },
  strongText: {
    fontWeight: 700,
    display: 'block',
    marginBottom: 8,
    fontSize: 18,
    color: '#4338ca',
  },
  listItem: {
    marginLeft: 16,
    position: 'relative' as const,
    paddingLeft: 20,
    marginBottom: 8,
    fontSize: 16,
  },
  listItemBefore: {
    content: '""',
    position: 'absolute' as const,
    left: 0,
    top: 8,
    width: 8,
    height: 8,
    borderRadius: '50%',
    backgroundColor: '#7c3aed',
  },
};

const LampIcon = () => (
  <svg
    aria-hidden="true"
    focusable="false"
    style={styles.iconSvg}
    xmlns="http://www.w3.org/2000/svg"
    viewBox="0 0 24 24"
    role="img"
  >
    <path d="M9 21h6v-1H9v1zM12 2a6 6 0 0 0-6 6c0 2.28 1.79 4.6 2.5 5.37V17a1 1 0 0 0 2 0v-3.63C16.21 12.57 18 10.28 18 8a6 6 0 0 0-6-6zM7.5 11a4.5 4.5 0 0 1 9 0c0 1.7-1.42 3.1-2.22 3.84a1 1 0 0 0-.28.71V17h-4v-1.44a1 1 0 0 0-.28-.7C8.92 14.12 7.5 12.69 7.5 11z" />
  </svg>
);

const PatentConditions: React.FC = () => {
  return (
    <>
      <link
        href="https://fonts.googleapis.com/css2?family=Inter:wght@400;700&display=swap"
        rel="stylesheet"
      />
      <section style={{ ...styles.container, ...styles.section }}>
        <div style={styles.headerBox}>
          <div style={styles.iconWrapper}>
            <LampIcon />
          </div>
          <h2 style={styles.title}>ĐIỀU KIỆN BẢO HỘ SÁNG CHẾ</h2>
        </div>

        <article style={styles.contentBlock}>
          <p style={styles.strongText}>
            Sáng chế được bảo hộ dưới hình thức cấp Bằng độc quyền sáng chế nếu đáp ứng các điều kiện sau:
          </p>
          <ul style={{ paddingLeft: 0, marginBottom: 32 }}>
            {[
              'Có tính mới;',
              'Có trình độ sáng tạo;',
              'Có khả năng áp dụng công nghiệp.',
            ].map((text, i) => (
              <li key={i} style={styles.listItem}>
                <span style={styles.listItemBefore}></span>
                {text}
              </li>
            ))}
          </ul>

          <p style={styles.strongText}>
            Sáng chế được bảo hộ dưới hình thức cấp Bằng độc quyền giải pháp hữu ích nếu đáp ứng các điều kiện sau:
          </p>
          <ul style={{ paddingLeft: 0 }}>
            {[
              'Có tính mới;',
              'Không phải là hiểu biết thông thường;',
              'Có khả năng áp dụng công nghiệp.',
            ].map((text, i) => (
              <li key={i} style={styles.listItem}>
                <span style={styles.listItemBefore}></span>
                {text}
              </li>
            ))}
          </ul>
        </article>
      </section>
    </>
  );
};

export default PatentConditions;
